import React, { useState } from 'react';

const MonitoringMetrics = () => {
  const [metrics, setMetrics] = useState({
    attendance: { registered: '', actual: '' },
    lectureDelivery: { quality: '', comments: '' },
    studentEngagement: { participation: '', questions: '' },
    classroomEnvironment: { venue: '', tech: '', atmosphere: '' }
  });
  const [entries, setEntries] = useState([]);

  const handleChange = (section, field, value) => {
    setMetrics(prev => ({
      ...prev,
      [section]: {
        ...prev[section],
        [field]: value
      }
    }));
  };

  const handleAdd = () => {
    setEntries(prev => [...prev, metrics]);
  };

  return (
    <div className="container mt-5">
      <h3>Monitoring Metrics</h3>

      {/* Attendance */}
      <h5 style={{ textDecoration: 'underline' }}>Attendance</h5>
      <div className="row mb-3">
        <div className="col">
          <input
            type="number"
            placeholder="Registered Students"
            className="form-control"
            value={metrics.attendance.registered}
            onChange={(e) => handleChange('attendance', 'registered', e.target.value)}
          />
        </div>
        <div className="col">
          <input
            type="number"
            placeholder="Actual Students Present"
            className="form-control"
            value={metrics.attendance.actual}
            onChange={(e) => handleChange('attendance', 'actual', e.target.value)}
          />
        </div>
      </div>

      {/* Lecture Delivery */}
      <h5 style={{ textDecoration: 'underline' }}>Lecture Delivery</h5>
      <div className="mb-3">
        <input
          type="text"
          placeholder="Quality"
          className="form-control"
          value={metrics.lectureDelivery.quality}
          onChange={(e) => handleChange('lectureDelivery', 'quality', e.target.value)}
        />
      </div>
      <div className="mb-3">
        <textarea
          placeholder="Comments"
          className="form-control"
          value={metrics.lectureDelivery.comments}
          onChange={(e) => handleChange('lectureDelivery', 'comments', e.target.value)}
        />
      </div>

      {/* Student Engagement */}
      <h5 style={{ textDecoration: 'underline' }}>Student Engagement</h5>
      <div className="mb-3">
        <input
          type="number"
          placeholder="Participation"
          className="form-control"
          value={metrics.studentEngagement.participation}
          onChange={(e) => handleChange('studentEngagement', 'participation', e.target.value)}
        />
      </div>
      <div className="mb-3">
        <input
          type="number"
          placeholder="Questions"
          className="form-control"
          value={metrics.studentEngagement.questions}
          onChange={(e) => handleChange('studentEngagement', 'questions', e.target.value)}
        />
      </div>

      {/* Classroom Environment */}
      <h5 style={{ textDecoration: 'underline' }}>Classroom Environment</h5>
      <div className="mb-3">
        <input
          type="text"
          placeholder="Venue"
          className="form-control"
          value={metrics.classroomEnvironment.venue}
          onChange={(e) => handleChange('classroomEnvironment', 'venue', e.target.value)}
        />
      </div>
      <div className="mb-3">
        <input
          type="text"
          placeholder="Technology"
          className="form-control"
          value={metrics.classroomEnvironment.tech}
          onChange={(e) => handleChange('classroomEnvironment', 'tech', e.target.value)}
        />
      </div>
      <div className="mb-3">
        <input
          type="text"
          placeholder="Atmosphere"
          className="form-control"
          value={metrics.classroomEnvironment.atmosphere}
          onChange={(e) => handleChange('classroomEnvironment', 'atmosphere', e.target.value)}
        />
      </div>

      {/* Add Button */}
      <button
        className="btn btn-primary mb-4"
        onClick={handleAdd}
      >
        Add Monitoring Entry
      </button>

      {/* Display Entries */}
      <h5 style={{ textDecoration: 'underline' }}>Stored Monitoring Metrics</h5>
      <table className="table table-bordered">
        <thead>
          <tr>
            <th>#</th>
            <th>Attendance (Registered / Actual)</th>
            <th>Lecture Quality</th>
            <th>Lecture Comments</th>
            <th>Participation</th>
            <th>Questions</th>
            <th>Venue</th>
            <th>Technology</th>
            <th>Atmosphere</th>
          </tr>
        </thead>
        <tbody>
          {entries.map((entry, index) => (
            <tr key={index}>
              <td>{index + 1}</td>
              <td>
                {entry.attendance.registered} / {entry.attendance.actual}
              </td>
              <td>{entry.lectureDelivery.quality}</td>
              <td>{entry.lectureDelivery.comments}</td>
              <td>{entry.studentEngagement.participation}</td>
              <td>{entry.studentEngagement.questions}</td>
              <td>{entry.classroomEnvironment.venue}</td>
              <td>{entry.classroomEnvironment.tech}</td>
              <td>{entry.classroomEnvironment.atmosphere}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default MonitoringMetrics;
